import React, { useState, useEffect } from 'react';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';
import PageH from "./Components/PageHeader";
import Home from "./Components/Home";
import SignIn from "./Components/SignIn";
import SignUp from "./Components/SignUp";
import Lists from "./Components/Lists";
import Rank from "./Components/Rank";

const server_url = 'http://localhost:11037';

function App() {
  const [movies, setMovies] = useState([]);
  const [searchValue, setSearchValue] = useState('');
  const [lists, setLists] = useState([]);
  const [list, setList] = useState([]);

  const getMovieRequest = async (searchValue) => {
    const options = {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({"searchValue": searchValue})
    }

    const response = await fetch(server_url + '/query/movies', options);

    const res = await response.json();

    console.log(res);

    if (res.Search) {
      setMovies(res.Search);
    }
  }

  useEffect(() => {
    getMovieRequest(searchValue);
  }, [searchValue]);

  const getList = async (list) => {
    console.log(list);
  }

  useEffect(() => {
    getList(list);
  }, [list]);

  return (
    <BrowserRouter>
      <div className="App">
        <PageH heading="Rankd" searchValue={searchValue} setSearchValue={setSearchValue}/>

        <div className="belowHead">
          <div className="pagesetup"></div>
          <Routes>
            <Route path='/' element={<Home />} />
            <Route path='/signin' element={<SignIn />} />
            <Route path='/signup' element={<SignUp />} />
            <Route path='/lists' element={<Lists movies={movies} lists={lists} setLists={setLists} list={list} setList={setList}/>} />
          </Routes>
          <div className="pagesetup"></div>
        </div>

      </div>
    </BrowserRouter>
  );
}

export default App;
